import Vue from 'vue'
import App from './App.vue'

import './icons'

import 'normalize.css/normalize.css'

import Element from 'element-ui'
import 'element-ui/lib/theme-chalk/index.css'
import store from './store'


Vue.use(Element,{
  size: 'medium', 
});

Vue.config.productionTip = false

new Vue({
  store,
  render: h => h(App)
}).$mount('#app')
